%[text] # Perform DOA estimation in 2D coordinate
%[text] 本文件考察 Doppler 频移对随机信号 DoA 估计的影响。
%[text] 随机信号采用白噪声，时间完全不相关，因此无法估计 Dopper。
clear(); close all;
%[text] ## Parameters
cxrFreq = 18e9;             % carrier frequency
wavelen = 1;                % normalized wavelength
elemSpacing = wavelen / 2;  % half-wavelength spacing
elemNum = 12;               % number of array elements
snapNum = 20000;              % number of signal snapshots
snr_db = 10;                % signal-to-noise ratio in dB
sourcePwr = 1;              % source signal power
noisePwr = sourcePwr / (10^(snr_db / 10)); % noise power from SNR

% doas = linspace(-pi/3, pi/4, 6);
doas = [30, 31]/180*pi;
dopplerList = (1:10e3:500e3) / (cxrFreq / 2);
dopplerNum = length(dopplerList);
sourceNum = length(doas);
%[text] ## Array formulation
% design a ULA with m elements
arrUla = design_array_1d('ula', elemNum, elemSpacing);
%[text] ## Signal Generation & DOA estimation
repeatNum = 2000;
estRmse = zeros(1,dopplerNum);
progressbar('reset', dopplerNum);

for i_doppler = 1:dopplerNum %[output:group:37ef2d22]

  dopplers = dopplerList(i_doppler) * ones(1, sourceNum);
  currRmse = 0;

  parfor i_repeat = 1:repeatNum %[output:84b4a20d]
    % Stochastic signal model
    [~, sampleCovMat, sourceSig] = snapshot_gen_sto(arrUla, doas, wavelen, snapNum, noisePwr, sourcePwr, dopplers);
    
    % Perform 1D music with 2D array
    specMusic = mle_sto_con_grid_1d(sampleCovMat, sourceNum, arrUla, wavelen, 180, 'RefineEstimates', true);
    
    % Compute the angular error in degrees
    if sourceNum == 1
      currRmse = currRmse + sqrt((specMusic.x_est - doas)^2);
    else
      currRmse = currRmse + sqrt(mean((sort(specMusic.x_est, 'ascend') - sort(doas, 'ascend')).^2));
    end
  end

  estRmse(i_doppler) = currRmse / (sourceNum * repeatNum);
  progressbar('advance'); %[output:0ccabadc]
end %[output:group:37ef2d22]
plot(dopplerList * (cxrFreq / 2), estRmse) %[output:5eacb07c]

